import React from "react";
import Book from "./Book";

const ReadList = ({ books, onSelect }) => (
  <div className="read-list">
    {books.map((book) => (
      <Book key={book.id} book={book} onSelect={onSelect} />
    ))}
  </div>
);

export default ReadList;
